import React from 'react';
import './Style.css';
import { Route } from 'react-router-dom';

function Navbar() {
  return (
    <nav id="AppNav" className="navbar">
      <div className='navbar-center'>
      <Switch>
          <Route path='/'><button id="Home_btn" type="button" className="btn btn-light m-4 mb-0">Characters</button></Route>
          <Route path='/'><button id="WatchList_btn" type="button" className="btn btn-light m-4 mb-0">Watch List</button></Route>
          <Route path='/'><button id="About_btn" type="button" className="btn btn-light m-4 mb-0">About</button></Route>
       </Switch>
      </div>
    </nav>
  );
}

export default Navbar;
